import React from "react";
import { Link, ListItem, Image, Box, List } from "@chakra-ui/react";

export default function MovieList({ movies }) {
  return (
    <List>
      {movies.map((movie) => (
        <ListItem key={movie.id}>{movie.title}
        <Box boxSize={400}>
        <Image h='100%' src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`}></Image>
        </Box>
        </ListItem>
      ))}
    </List>
  );
}
